import React from 'react';
import Card from 'react-bootstrap/Card';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';

// Import images individually (no need to use require separately)
import blog1 from 'src/assets/images/blog1.jpg';
import blog2 from 'src/assets/images/blog2.jpg';
import blog3 from 'src/assets/images/blog3.jpg';
import blog4 from 'src/assets/images/blog4.jpg';

const images = [blog1, blog2, blog3, blog4];

function Grid() {
    return (
        <Row xs={1} md={2} className="g-4">
            {images.map((image, idx) => (
                <Col key={idx}>
                    <Card>
                        <Card.Img variant="top" src={image} alt={`Blog ${idx + 1}`} />
                        <Card.Body>
                            <Card.Title>Card title</Card.Title>
                            <Card.Text>
                                This is a longer card with supporting text below as a natural
                                lead-in to additional content. This content is a little bit
                                longer.
                            </Card.Text>
                        </Card.Body>
                    </Card>
                </Col>
            ))}
        </Row>
    );
}

export default Grid;
